import React from 'react'
import Hello from './Hello'

const App4 = () => {
  return (
    <>
        <h1 style={{textAlign : "center"}}>HOC</h1>
        <Hello color = "red" />   
        <Hello color = "blue"/>   
        <Hello color = "yellow"/>   
    </>
  )
}



export default App4
